findStrings.find:
private void vpush\(Object obj\) \{
 stack\.push\(obj\)\;
 \}

 /\*\*
 \* Get variable from scope stack and push it to top of stack
 \*
 \* \@param name name of variable to be pushed in stack
 \*/
 private void vpush\(String name\) \{
 stack\.push\(scopeStack\.get\(name\)\)\;
 \}

 /\*\*
 \* Add variable name to the symbol table of current scope
 \*
 \* \@param name
 \*/
 public void add\(String name\) \{
 scopeStack\.add\(name\)\;
 \}

 /\*\*
 \* Assign to a variable with name value from top of the stack
 \*
 \* \@param name
 \*/
 private void assign\(String name\) \{
 assign\(name\, stack\.pop\(\)\)\;
 \}

 /\*\*
 \* Assign value to variable in the scope\, i\.e\. add it into current symbol table
 \*
 \* \@param name
 \* \@param val
 \*/
 private void assign\(String name\, Object val\) \{
 scopeStack\.assign\(name\, val\)\;
 \}

 /\*\*
 \* Invokes function with given name
 \*
 \* \@param name name of function
 \*/
 private void invoke\(String name\) \{
 scopeStack\.invoke\(name\)\;
 \}

 /\*\*
 \* Add 2 variables from top of the stack and put result on top of the stack
 \*/
 private void plus\(\) \{
 Object var1 \= stack\.pop\(\)\;
 Object var2 \= stack\.pop\(\)\;
 stack\.push\(op\.plus\(var1\, var2\)\)\;
 \}

 private void minus\(\) \{
 Object var1 \= stack\.pop\(\)\;
 Object var2 \= stack\.pop\(\)\;
 stack\.push\(op\.minus\(var1\, var2\)\)\;
 \}

 private void multiply\(\) \{
 Object var1 \= stack\.pop\(\)\;
 Object var2 \= stack\.pop\(\)\;
 stack\.push\(op\.multiply\(var1\, var2\)\)\;
 \}

 private void more\(\) \{
 Object var1 \= stack\.pop\(\)\;
 Object var2 \= stack\.pop\(\)\;
 stack\.push\(op\.more\(var1\, var2\)\)\;
 \}

 private void notequal\(\) \{
 Object var1 \= stack\.pop\(\)\;
 Object var2 \= stack\.pop\(\)\;
 stack\.push\(op\.notequal\(var1\, var2\)\)\;
 \}

 private
